import React from "react";
import TopNav from '../components/Navbar/TopNav';
import Cart_product from '../components/Cart_product';
import Cart_product2 from '../components/Cart_product2';
import MariaFloristaFavourite from '../components/MariaFloristaFavourite';
import { useNavigate } from 'react-router-dom';



const Cart1 = () => {
    const navigate = useNavigate();

    function cart() {
      navigate('/cart');
    }

    function buy() {
        navigate('/buy');
      }

    return(
        <div className='full_div2'>
            <TopNav />



            <div style={{ display: 'flex', justifyContent: 'space-between', alignItems: 'flex-start', width: '80%', margin: '0 auto',marginTop:'50px'}}>
                <div style={{ border: '2px solid green', padding: '20px', borderRadius: '10px', boxSizing: 'border-box', width: '100%' }}>
                    <div><h3>Your Cart</h3></div>
                    <Cart_product></Cart_product>
                    <Cart_product2></Cart_product2>
                </div>
                <div className = 'product_wrapper' >

                <div style={{ marginTop : '50px'}}>
                </div>
                <div className = 'product_text' style={{ marginTop : '50px'}}>
                <button className = "product-wrapper" style={{ marginRight: '10px',backgroundColor: '#6B8E23', color: 'white', padding: '5px 20px', fontSize:'20px', borderRadius: '5px', border: 'none', cursor: 'pointer',marginTop:'5px' }}onClick={buy}>Checkout</button></div>

            </div>


            </div>
            <div style={{marginTop:'200px',width: '100%', height: '100px', backgroundColor: '#6B8E23'}}></div>
        </div>  
    );
}
export default Cart1;
